import React from "react";
import { Text, StyleSheet, View } from "react-native";
import ImageDetail from "../components/ImageDetail";

const ImageScreen = () => {
  return (
    <View>
      <ImageDetail title="Forest" imageSource={require('./img/forest.jpg')} imageScore={9}/>
      <ImageDetail title="Beach" imageSource={require('./img/beach.jpg')} imageScore={7}/>
      <ImageDetail title="Mountain" imageSource={require('./img/mountain.jpg')} imageScore={4}/>
    </View>
  );
};

const styles = StyleSheet.create({});

export default ImageScreen;
